section Section1;
shared DelimitedText1 = let
  AdfDoc = AzureStorage.DataLakeContents("https://storageyamslab.dfs.core.windows.net/bucket-yams-lab/202007-capitalbikeshare-tripdata.csv"),
  Csv = Csv.Document(AdfDoc, [Delimiter = ",", Encoding = TextEncoding.Utf8, QuoteStyle = QuoteStyle.Csv])
in
  Csv;
shared UserQuery = let
  Source = DelimitedText1
in
  Source;
